        "mantananiIsland":
            MessageLookupByLibrary.simpleMessage("Ilha de Mantanani"),
        "mantananiIslandContent": MessageLookupByLibrary.simpleMessage(
            "Perto de Kota Belud, em Sabah, a ilha de Mantanani oferece alguns dos melhores pontos de mergulho em Bornéu. Mergulhadores e praticantes de snorkeling vêm nadar com cavalos-marinhos e arraias em excursões de um dia saindo da capital. Quem possui certificação de mergulho pode explorar mais de 20 locais, incluindo três naufrágios. Após algumas horas no Mar da China Meridional, relaxe e aproveite o famoso pôr do sol de Bornéu nas praias de areia branca e limpa."),
