        "miles_hotel": MessageLookupByLibrary.simpleMessage("Hotel 1000 Miles"),
        "mossyForest": MessageLookupByLibrary.simpleMessage(
            "Floresta Musgosa, Cameron Highlands"),
        "mossyForestContent": MessageLookupByLibrary.simpleMessage(
            "A Floresta Musgosa é um ecossistema natural que cresce apenas nas altitudes mais elevadas das Cameron Highlands e outras cadeias montanhosas da Malásia. Nuvens de baixa altitude, movidas pelo vento, cobrem as árvores com névoa e umidade persistente, proporcionando um habitat perfeito para musgos, samambaias, líquens e orquídeas. Esta floresta tropical úmida também serve de refúgio para uma diversidade de espécies de montanha, incluindo borboletas, roedores, sapos, pássaros e mamíferos que só existem neste clima frio."),
        "mountPulai":
            MessageLookupByLibrary.simpleMessage("Monte Pulai, Johor"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "O Monte Pulai é uma montanha de 654 metros em Johor, Península da Malásia. Devido à sua proximidade e facilidade de entrada, é um destino popular de caminhada para singapurianos e locais. O topo do Monte Pulai não está aberto ao público, pois é protegido pelo exército e abriga duas torres de comunicação. O Monte Pulai possui uma trilha circular de 14,3 quilômetros com trânsito moderado perto de Kulai, Johor, com uma cachoeira e um nível de dificuldade. A trilha também é usada para camping, ciclismo, corrida e caminhadas na natureza."),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
            "O Metrô de Massa (MRT) é dividido em duas linhas; a primeira é a linha Sungai Buloh-Kajang, com 51 km de extensão e 31 estações ao longo da rota. Todas as estações começam a operar às 6:00 AM diariamente. Os horários de encerramento variam com base nas estações. Uma viagem única custa a partir de RM1.20. Linha de atendimento: 1800-82-6868"),
        "mrtTitle":
            MessageLookupByLibrary.simpleMessage("Metrô de Massa (MRT)"),
