        "nasiLemakDescription": MessageLookupByLibrary.simpleMessage(
            "Nasi Lemak é arroz perfumado cozido tradicionalmente em leite de coco e folhas de pandan, servido com sambal picante, pepinos, anchovas fritas, ovo e amendoins fritos. É melhor acompanhado de um copo de teh tarik quente. A maioria das lojas ou barracas oferece outras opções de acompanhamento, como frango ou rendang de carne, frango frito, sambal de camarão e muito mais."),
        "nationalArtGallery":
            MessageLookupByLibrary.simpleMessage("Galeria Nacional de Arte"),
