        "nationalMuseumDescription": MessageLookupByLibrary.simpleMessage(
            "Para entender mais sobre a história e cultura da Malásia e ver réplicas de casas malaias, cenas de casamento e exposições de caça. Instrumentos locais e trajes nacionais também estarão em exibição. Além das exposições permanentes no museu, há também exposições temporárias que mudam ao longo do ano e estão situadas no Salão Central."),
        "next": MessageLookupByLibrary.simpleMessage("Próximo"),
        "nightLife": MessageLookupByLibrary.simpleMessage("Vida Noturna"),
        "nightMarket": MessageLookupByLibrary.simpleMessage("Mercado Noturno"),
        "nightOutDescription": MessageLookupByLibrary.simpleMessage(
            "Kuala Lumpur é uma cidade vibrante com uma cena noturna incrível. Vá até Bangsar ou Changkat Bukit Bintang para experimentar a vida noturna de KL. Esses lugares têm uma variedade de bares para escolher, com seus próprios bares de coquetéis e DJs tocando música a noite toda. Com seus restaurantes únicos, bares modernos, boates e locais de karaokê, há algo para todos."),
