        "ourCompanyDescription": MessageLookupByLibrary.simpleMessage(
            "KL O Guia é um guia trimestral, publicado pela primeira vez em agosto de 2007. Somos um guia de viagem gratuito que ajuda os viajantes a planejar suas viagens pela capital da Malásia, Kuala Lumpur. O KL O Guia inclui dicas de viagem, lugares para explorar, locais adequados para crianças, hotéis e muito mais. Com o KL O Guia, navegar pela cidade se torna mais fácil."),
