        "pangkorIsland":
            MessageLookupByLibrary.simpleMessage("Ilha de Pangkor"),
        "pangkorIslandContent": MessageLookupByLibrary.simpleMessage(
            "Confira a Ilha de Pangkor se você está procurando um lugar sem turistas. Localizada perto da costa de Perak, a ilha possui praias vazias, água limpa e uma densa floresta no centro. Os visitantes apreciam a oportunidade de tomar sol sob as palmeiras sem ninguém por perto. Além disso, visite o forte colonial holandês e tire fotos de um cais de madeira tradicional."),
        "panoramaHill": MessageLookupByLibrary.simpleMessage(
            "Colina Panorama, Sungai Lembing"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "A Colina Panorama é uma colina em Sungai Lembing, a 45 quilômetros a noroeste de Kuantan. Com uma altura de 271 metros, há apenas um caminho para subir. Comece na base da escada e vá subindo. A característica principal da trilha é uma escada com corrimãos; apenas alguns trechos curtos não têm escada. Ao chegar ao topo da colina, você verá uma vista panorâmica da cidade ao redor. Normalmente, os visitantes levam de 30 a 45 minutos para subir a Colina Panorama."),
        "parks": MessageLookupByLibrary.simpleMessage("Café"),
        "penangNationalPark": MessageLookupByLibrary.simpleMessage(
            "Parque Nacional de Penang, Penang"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "Este é o menor parque nacional da Malásia, com uma área de 23 quilômetros quadrados, mas suas florestas costeiras são lar de macacos-folha prateados, lêmures voadores, gatos-leopardo e uma variedade de lagartos, anfíbios e répteis. Atividades como caminhadas na selva e passeios de barco até praias de areia dourada e tranquilas podem preencher o dia com facilidade. Existem duas trilhas principais no parque: uma que leva ao longo da costa até a Praia dos Macacos, e outra que atravessa as colinas e a selva até praias mais isoladas, onde se encontra o Santuário das Tartarugas."),
        "petalingStreet":
            MessageLookupByLibrary.simpleMessage("Petaling Street"),
        "petalingStreetDescription": MessageLookupByLibrary.simpleMessage(
