        "pulauLangkawi":
            MessageLookupByLibrary.simpleMessage("Ilha de Pulau Langkawi"),
        "pulauLangkawiContent": MessageLookupByLibrary.simpleMessage(
            "A ilha de Langkawi abriga algumas das melhores praias da Península da Malásia. A ilha combina montanhas e manguezais com praias cintilantes. Faça uma viagem de um dia para Pulau Dayang Bunting, listada pela UNESCO, alimente as águias e observe os macacos nadando em busca de comida. Ou pegue sua toalha e tome sol em Pantai Cenang antes de beber em um bar de praia. Outra vantagem é que esta ilha é livre de impostos, não hesite em liberar seu lado comprador quando estiver lá!"),
        "pulauRedang":
            MessageLookupByLibrary.simpleMessage("Ilha de Pulau Redang"),
        "pulauRedangContent": MessageLookupByLibrary.simpleMessage(
            "Uma das maiores ilhas da costa leste da Malásia, Pulau Redang é conhecida por suas águas cristalinas e praias de areia branca. É uma das nove ilhas que formam um parque santuário marinho que oferece aos turistas a oportunidade de fazer snorkeling e mergulho. A praia é composta por areia branca e macia. Você pode ver corais e peixes a poucos metros da praia."),
        "rapidKLBusDescription": MessageLookupByLibrary.simpleMessage(
            "O Ônibus RapidKL é frequentemente visto nas estações de trem e geralmente atua como um meio de transporte de trânsito para passageiros chegarem diretamente aos seus destinos preferidos. Cada viagem pode custar até RM5.00, que pode ser pago com o valor exato ou usando o cartão Touch n’ Go na entrada e saída. Linha de atendimento: 03-7885 2585"),
