        "sevenWellsContent": MessageLookupByLibrary.simpleMessage(
            "A Cachoeira dos Sete Poços, também conhecida como Jalan Telaga Tujuh, fica a cerca de 20 minutos a pé da famosa Langkawi Sky Bridge e é uma das atrações naturais mais impressionantes da ilha. A cachoeira desce o Monte Mat Cincang, o segundo pico mais alto de Langkawi, e é popular entre turistas e locais. A queda total é de 91 metros, mas apenas uma pequena seção é visível de baixo. Segundo a lenda, esta cachoeira é o lar de fadas, e o rio possui propriedades calmantes. A cachoeira parece mágica, rodeada pela natureza rica em flora e fauna."),
