        "sipadanIslandContent": MessageLookupByLibrary.simpleMessage(
            "Uma pequena ilha perto de Semporna, em Sabah, é classificada entre as melhores regiões de mergulho do mundo. Você não encontrará acomodações ou muitas instalações na ilha. Recomenda-se fazer um passeio durante sua viagem. O voo de Kota Kinabalu para Semporna e uma viagem de barco de uma hora para ver as tartarugas e cardumes de barracudas vale a pena. Após obter o status de proteção em 2002, menos turistas conseguem permissão para visitar o pináculo de calcário."),
