        "sungaiLembing":
            MessageLookupByLibrary.simpleMessage("Sungai Lembing, Pahang"),
        "sungaiLembingContent": MessageLookupByLibrary.simpleMessage(
            "A Malásia é abençoada com inúmeras florestas tropicais que abrigam cachoeiras deslumbrantes. A Cachoeira do Arco-Íris está situada a 45 quilômetros a noroeste de Kuantan, na Malásia Peninsular, na cidade de Sungai Lembing. Todas as manhãs, entre 9h e 10h, o sol reflete na água da cachoeira, criando um belo arco-íris. Pessoas de todo o mundo viajam por uma hora e meia até a cachoeira para contemplar a beleza da natureza. A Cachoeira do Arco-Íris é uma grande cachoeira escondida na área de floresta tropical de Sungai Lembing, acessível por veículo 4x4 e trilha."),
        "sungaiPisangContent": MessageLookupByLibrary.simpleMessage(
            "A Cachoeira Pisang é uma trilha de ida e volta de 3,1 quilômetros com uma cachoeira perto de Gombak, Selangor, Malásia. É adequada para caminhantes de todos os níveis. A trilha está aberta durante todo o ano e é frequentemente usada para camping, ciclismo e observação de pássaros. Perto do topo da cachoeira, há ótimos locais para piqueniques e acampamentos. Uma caminhada de lazer que exige atravessar uma cachoeira, esteja preparado para sapatos molhados."),
