        "uluCheporContent": MessageLookupByLibrary.simpleMessage(
            "Lata Ulu Chepor fica a apenas 10 quilômetros da cidade de Ipoh e é cercada por colinas verdes de floresta tropical. O parque é acessível pela Rota A1 para Chemor, perto da praça de pedágio Ipoh Utara. Este lugar é ideal para respirar ar fresco, descansar e fazer piqueniques nos fins de semana. Para os visitantes que desejam ficar mais tempo ou participar de atividades educativas e recreativas, há facilidades como área de camping, salão multiuso, sala de orações e banheiro. O parque é bem conservado e sinalizado na pista principal."),
