        "weatherDescription": MessageLookupByLibrary.simpleMessage(
            "O clima em Kuala Lumpur é bastante úmido o ano todo. Quem estiver viajando para KL deve sempre estar preparado para chuvas a qualquer momento do ano. No entanto, o melhor período para visitar KL é de maio a julho ou de dezembro a fevereiro. O clima pode ser bastante quente entre março e abril. Devido aos incêndios florestais em Sumatra, que geralmente ocorrem entre junho e agosto, as partículas de poeira podem criar uma névoa sobre KL, tornando essa época menos ideal para visitar a cidade."),
